import React, { Component } from 'react';
import { Card, TextField, Button, Container } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';

const useStyles = withStyles((theme) => ({
    paper: {
        marginTop: theme.spacing(8),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    avatar: {
        margin: theme.spacing(1),
        backgroundColor: theme.palette.secondary.main,
    },
    form: {
        width: '100%', // Fix IE 11 issue.
        marginTop: theme.spacing(1),
    },
    submit: {
        margin: theme.spacing(3, 0, 2),
    },
}));

class Login extends Component {
    render() {
        const { classes } = this.props;
        return (
            <div>
                <Container component="main" maxWidth="xs">
                    <Card style={{ padding: "12px" }}>
                        <form className={classes.form} noValidate>
                            <TextField variant="outlined" fullWidth type="email" id="standard-basic" label="Email" />
                            <TextField fullWidth type="password" id="standard-basic" label="Password" />
                            <Button type="submit" variant="contained">Sign In</Button>
                        </form>
                    </Card>

                </Container>

            </div>
        );
    }
}

export default withStyles(useStyles)(Login) ;
